import './App.css';

function App() {
  return (
    <div className="App">
        <label>Product name:</label>
        <input type={"text"}/>
        <label>Amount:</label>
        <input type={"number"}/>
        <label>Price:</label>
        <input type={"number"}/>
        <label>Details:</label>
        <input type={"text"}/>
        <label>Description:</label>
        <input type={"text"}/>
    </div>
  );
}

export default App;
